function AttribUpdate(id)
{
	document.getElementById('attrivalues').value=id;
	document.getElementById('required').style.display='none';
	document.getElementById('selectsize').innerHTML="<div class='text'>Your Choice Size: "+document.getElementById('Attrtext'+id).className+"</div>";
	for(i=1; i <=6; i++)
	 {
		 if(i == id)
	     document.getElementById('attribs'+i).className = "select";
		else
		 document.getElementById('attribs'+i).className = "selectAttr";
	 }
}

          function AttribUpdate(id){
	document.getElementById('attrivalues').value=id;
	document.getElementById('selectsize').innerHTML= "<div class='text'>Your Choice Size: "+document.getElementById('Attrtext'+id).className+"</div>";
	for(i=2; i <= 19; i++) {
	if(i == id){
		document.getElementById('attribs'+i).className = "select";
		document.getElementById('attrib-1').className="";
		document.getElementById('choose_size').innerHTML= "";
	}

	else{
		if(document.getElementById('attribs'+i)){
			document.getElementById('attribs'+i).className = "selectAttr";
			}
		}
	}

}
